import React, { useEffect, useState } from "react";
import { json } from "stream/consumers";
import { resourceLimits } from "worker_threads";
import "./App.css";

type book = {
  id: string;
  name: string;
};

function App() {
  const [result, setResult] = useState<book[]>([]);

  const fetchData = () => {
    fetch("https://the-one-api.dev/v2/book")
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        setResult(data);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>
        {result.map((value) => {
          return (
            <div>
              <div>{value.id}</div>
              <div>{value.name}</div>
            </div>
          );
        })}
      </h1>
    </div>
  );
}

export default App;
